app1.controller("FileCtrl",["$scope","$routeParams","$location","SessionService",function(e,t,a,n){e.sessionData=n.getSessionData();var i=function(){if("undefined"==t.iframe_file||"undefined"==t.application_id)a.url("/applications");else{if(e.sessionData.application_id=t.application_id,e.sessionData.applications){for(var i=e.sessionData.applications,o=0;o<i.length;o++)if(i[o].translated_name=n.translate(i[o].name),i[o].translated_description=n.translate(i[o].description),i[o]._id==t.application_id){e.sessionData.applicationName=i[o].translated_name;break}n.setSessionData(e.sessionData)}document.getElementById("iframe_file").src="https://docs.google.com/viewer?url="+encodeURI("https://app1.cloud/file/"+t.iframe_file)+"&embedded=true"}};e.$watch(function(){return n.getSessionData().applications},function(t,a){t!=a&&(e.sessionData=n.getSessionData(),i())}),i()}]);
